import React from 'react'
import './style.css'

class App extends React.Component {
  state = {
    country: 'Russia!'
  }

  render() {
    return (
      <div>
        <div className='topContainer'>
          <h1>{this.state.country}</h1>
        </div>
        <div>
          <img 
            className='countryFlag'
            src='https://cdn.countryflags.com/thumbs/russia/flag-round-250.png' 
            alt='' 
          />
        </div>
      </div>
    )
  }

}

export default App;
